    pos1 = (0, 0)
    for k in range(len(commands)):
        pos1 = (pos1[1] + Moves[k][0], pos1[1] + Moves[k][1])
        block = pos1
        pos = (0, 0)
        for i in range(len(commands)):
            pos_next = (pos[0] + Moves[i][0], pos[1] + Moves[i][1])
            if pos_next != block:
                pos = pos_next
        if pos == (0, 0):
            return block
    return (0, 0)

